import React from 'react';
import * as ReactBootStrap from 'react-bootstrap';

const About = () => {
    return (
        <section id="About">
            <ReactBootStrap.Container fluid="md">
                <ReactBootStrap.Row>
                    <img className="about-bg" src="/assets/6466.jpg" />
                </ReactBootStrap.Row>
            </ReactBootStrap.Container>
        </section>
    )
}
export default About
